window.bookSummaryJSON = "<p><b>E L James revisits the world of Fifty Shades with a deeper and darker take on the love story that has enthralled millions around the globe. </b></p> <p><b>Look for E L Jamesâ€™ passionate new love story,&nbsp;</b><b><i>The Mister</i></b><b>, available now. </b>&nbsp;</p> <p>Christian Grey exercises control in all things; his world is neat, disciplined, and utterly empty - until the day that Anastasia Steele falls into his office, in a tangle of shapely limbs and tumbling brown hair. He tries to forget her, but instead is swept up in a storm of emotion he cannot comprehend and cannot resist. Unlike any woman he has known before, shy, unworldly Ana seems to see right through him - past the business prodigy and the penthouse lifestyle to Christian's cold, wounded heart.&nbsp;</p> <p>Will being with Ana dispel the horrors of his childhood that haunt Christian every night? Or will his dark sexual desires, his compulsion to control, and the self-loathing that fills his soul drive this girl away and destroy the fragile hope she offers him?&nbsp;</p> <p><b>This audiobook is intended for mature audiences.</b></p>"; 
